// src/components/Projects.js
import React, { useEffect, useState, useContext } from "react";
import ThemeContext from "../context/ThemeContext";

// Function to convert language name to CSS class name
const getLanguageClassName = (lang) => {
  if (!lang) return '';
  
  // Special cases that don't follow the standard pattern
  const specialCases = {
    'C++': 'cpp',
    'C#': 'csharp',
    'Jupyter Notebook': 'jupyter'
  };
  
  // Check if it's a special case
  if (specialCases[lang]) return `tech-tag-${specialCases[lang]}`;
  
  // Convert to lowercase and replace spaces with hyphens
  return `tech-tag-${lang.toLowerCase().replace(/\s+/g, '')}`;
};

const Projects = () => {
  const [repos, setRepos] = useState([]);
  const [languages, setLanguages] = useState({});
  const { isDark } = useContext(ThemeContext);

  // Function to fetch languages for a repository
  const fetchLanguages = async (repoName) => {
    try {
      const response = await fetch(`https://api.github.com/repos/TheOnlyBaddy/${repoName}/languages`);
      if (!response.ok) return [];
      const data = await response.json();
      return Object.keys(data);
    } catch (error) {
      console.error(`Error fetching languages for ${repoName}:`, error);
      return [];
    }
  };

  useEffect(() => {
    const fetchRepos = async () => {
      try {
        const response = await fetch("https://api.github.com/users/TheOnlyBaddy/repos");
        if (!response.ok) {
          throw new Error(`GitHub API error: ${response.status}`);
        }
        const data = await response.json();
        const filtered = Array.isArray(data) 
          ? data.filter(repo => !repo.fork && !repo.private)
          : [];
        
        setRepos(filtered);
        
        // Fetch languages for each repository
        const languagesData = {};
        for (const repo of filtered) {
          const repoLanguages = await fetchLanguages(repo.name);
          languagesData[repo.name] = repoLanguages;
        }
        setLanguages(languagesData);
      } catch (err) {
        console.error(err);
        setRepos([]);
      }
    };

    fetchRepos();
  }, []);

  return (
    <section id="projects"
      className={`py-10 transition-colors duration-500 ${
        isDark ? "bg-gray-900 text-white" : "bg-gray-100 text-gray-900"
      }`}
    >
      <div className="container mx-auto px-4 sm:px-6">
        <h2 className="text-3xl font-bold mb-6 text-center">My Projects</h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
          {repos.map((repo) => (
            <div
              key={repo.id}
              className={`p-5 rounded-2xl shadow-md transform transition hover:-translate-y-2 hover:shadow-xl ${
                isDark ? "bg-gray-800 text-gray-200" : "bg-white text-gray-900"
              }`}
            >
              <h3 className="text-xl font-semibold mb-2">{repo.name}</h3>
              <div className="text-sm mb-4 space-y-3">
                {repo.description ? (
                  repo.description.split('. ').map((sentence, index, array) => {
                    if (!sentence.trim()) return null;
                    const text = index === array.length - 1 ? sentence : `${sentence}.`;
                    return (
                      <div key={index} className="flex items-start group">
                        <span className={`
                          inline-block w-1 h-1 rounded-full mt-2.5 mr-3 flex-shrink-0
                          ${isDark ? 'bg-blue-400' : 'bg-blue-600'}
                          group-hover:scale-125 transition-transform duration-200
                        `}>
                        </span>
                        <span className="leading-relaxed text-justify">
                          {text}
                        </span>
                      </div>
                    );
                  })
                ) : (
                  <div className="text-gray-500">No description provided</div>
                )}
                
                {/* Technology Tags */}
                {languages[repo.name]?.length > 0 && (
                  <div className="mt-4">
                    <h4 className="text-sm font-medium mb-2 text-gray-700 dark:text-gray-300">
                      Technologies Used: 
                    </h4>
                    <div className="flex flex-wrap gap-2">
                      {languages[repo.name].map((lang) => {
                        const languageClass = getLanguageClassName(lang);
                        return (
                          <span 
                            key={lang}
                            className={`tech-tag ${languageClass}`}
                            title={lang}
                          >
                            {lang}
                          </span>
                        );
                      })}
                    </div>
                  </div>
                )}
              </div>
              <a
                href={repo.html_url}
                target="_blank"
                rel="noopener noreferrer"
                className="text-blue-500 hover:underline"
              >
                View on GitHub â†’
              </a>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
